logger = setup_logger().getLogger(__name__)


class EmailTemplateMaker:
    """Makes email templates from the parsed data."""

    def __init__(self, res_map):
        self.res_map = res_map

    def make_email(self):
        """Makes the email template using jinja2 and saves them to temp for now"""
        emails = []
        for name, finding_groups in self.res_map.items():
            grouped_findings = {}
            for f in finding_groups:
                asset = f["asset_name"]
                if asset not in grouped_findings:
                    grouped_findings[asset] = []
                grouped_findings[asset].append(f)

            for _, v in grouped_findings.items():
                v.sort(key=lambda x: x["date_found"])

            template = Template(
                ("").join(("").join(self.get_email_template().split("\t")).split("\n"))
            )

            num_tasks = sum(list(map(lambda x: len(x), grouped_findings.values())))

            rendered = template.render(
                user_name=name[0],
                findings=grouped_findings,
                datetime=datetime,
                length=num_tasks,
                relativedelta=relativedelta,
                tldr=Counter(list(map(lambda x: x["risk_level"], finding_groups))),
            )

            # just change z5480907@ad.unsw.edu.au to finding_groups[0]['email'] siva.kumar@anglernook.com TODO
            emails.append(
                {
                    "name": "z3539013@ad.unsw.edu.au",
                    "html": rendered,
                    "total_tasks": (
                        "You have 1 Outstanding Task"
                        if num_tasks == 1
                        else f"You have {num_tasks} Outstanding Tasks"
                    ),
                }
            )

        return self.res_map.items(), emails

